// Join helpers: expose a function that performs the join and returns results
export function joinTeachersAndActivities(teachersArr = teachers, dataArr = data) {
	const teachersById = new Map(teachersArr.map(t => [t.id, t]));

	// Return one flattened array where each row has exactly these 6 fields:
	// Teacher_id, Teacher_name, Grade, Subject, Activity_type, Created_at
	return dataArr.map(row => ({
		Teacher_id: row.Teacher_id,
		Teacher_name: (teachersById.get(row.Teacher_id) || {}).Teacher_name || null,
		Grade: row.Grade,
		Subject: row.Subject,
		Activity_type: row.Activity_type,
		Created_at: row.Created_at
	}));
}

// Default single-array export
export const result = joinTeachersAndActivities();
 